import axios from 'axios';

const ROUTESURL_REST_API_URL = 'http://localhost:8080/api/routes'

class RouteURLService {
    getRoutes() {
        axios.get(ROUTESURL_REST_API_URL);
    }
}

export default new RouteURLService();
